const Card = ({ name, email, id }) => {
	return (
      <div className='tc bg-light-gold dib br3 pa3 ma2 grow bw2 shadow-5'>
      	<img alt='robots' src={`https://robohash.org/${id}?10x10`} />
      	<div>
        	<h2>{name}</h2>
        	<p>{email}</p>
      	</div>
      </div>
	);
}

export default Card;
